const request = require('supertest');
const session = require('./session')();
const { assert, expect } = require('chai');

module.exports = app => {
    describe('News CRUD should be working', function() {
        const newSent = {
            title: 'A great thing happend',
            description: 'test',
            author: 'John Jonny John',
            menu: 1,
            abstract: 'Test',
            text: `
                Just a test
            `,
            cover: getCovers().shift(),
            published_at: '2019-03-17 15:00:00'
        };

        const newSent2 = { 
            title: 'A thing happend',
            description: 'A thing happened in some place',
            author: 'Jonny John',
            menu: 1,
            abstract: `
            Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia.
            `,
            text: `
            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.

            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.

            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.

            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.
            `,
            cover: getCovers().shift(),
            published_at: '2019-03-17 15:25:52'
        };

        it("Create", done => {
            request(app)
                .post('/cms/new/')
                .send(newSent)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    request(app)
                        .post('/cms/new/')
                        .send(newSent)
                        .set('Accept', 'application/json')
                        .set('Auth-Token', session.user.token)
                        .expect(200)
                        .end(function(err, res) {
                            if (err) throw err;
                            done();
                        });
                });
        });

        it("Retrieve", done => {
            request(app)
                .get('/cms/new')
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    const news = res.body;
                    expect(news).to.not.be.eql(undefined);
                    const neww = news.reverse().pop();
                    expect(neww).to.not.be.eql(null);
                    assert(neww.title, newSent.title);
                    assert(neww.description, newSent.description);
                    assert(neww.author, newSent.author);
                    assert(neww.menu, newSent.menu);
                    assert(neww.abstract, newSent.abstract);
                    assert(neww.text, newSent.text);
                    assert(neww.published_at, newSent.published_at);
                    newSent.id = neww.id;
                    done();
                });
        });

        it("Update", done => {
            newSent.title = newSent2.title;
            newSent.description = newSent2.description;
            newSent.author = newSent2.author;
            newSent.abstract = newSent2.abstract;
            newSent.text = newSent2.text;
            newSent.cover = newSent2.cover;
            newSent.published_at = newSent2.published_at;
            request(app)
                .put(`/cms/new/${newSent.id}`)
                .send(newSent)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    done();
                });
        });

        it("Check update", done => {
            request(app)
                .get(`/cms/new/id/${newSent.id}`)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    const neww = res.body;
                    expect(neww).to.not.be.eql(null);
                    assert(neww.title, newSent.title);
                    assert(neww.description, newSent.description);
                    assert(neww.author, newSent.author);
                    assert(neww.menu, newSent.menu);
                    assert(neww.abstract, newSent.abstract);
                    assert(neww.text, newSent.text);
                    assert(neww.cover, newSent.cover);
                    assert(neww.published_at, newSent.published_at);
                    newSent.id = neww.id;
                    done();
                });
        });

        it("Delete", done => {
            request(app)
                .delete(`/cms/new/${newSent.id}`)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    done();
                });
        });

        it("Check deletion", done => {
            request(app)
                .get('/cms/new/')
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    const covers = res.body;
                    expect(covers.length).to.be.eql(1);
                    done();
                });
        });
    });
}

function getCovers() {
    return [
        ``
    ]
}